(505, 1, 'ေရႊဇင္ - သမုိင္းဘူတာရုံလမ္း ႏွင့္ တပင္ေရႊထီးလမ္းေထာင့္၊ ဘုရင့္ေနာင္။', '၀၉-၇၃၁၇၁၄၉၉', 'သမုိင္းဘူတာရုံလမ္း ႏွင့္ တပင္ေရႊထီးလမ္းေထာင့္၊ ဘုရင့္ေနာင္။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
(506, 1, 'ေရႊဇင္ - ဗဟန္း ၊ေရတာရွည္လမ္း။', '၀၉-၇၃၂၃၇၁၅၈', 'ဗဟန္း ၊ေရတာရွည္လမ္း။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
(507, 1, 'ေရႊဇင္ - ေဇာတိကအိမ္ယာ၊ ခပ္ခ်ီးယားမွတ္တုိင္၊ သဃၤန္းကြ်န္း။', '၀၉-၄၃၁၄၀၄၀၅', 'ေဇာတိကအိမ္ယာ၊ ခပ္ခ်ီးယားမွတ္တုိင္၊ သဃၤန္းကြ်န္း။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
(508, 1, 'ေရႊဇင္ - အမွတ္္(၂၇)၊ အေနာက္ျမင္းျပိဳင္ကြင္းလမ္း၊ ဗုိလ္စိန္မွန္၊ ဂြတ္တလစ္။', '၀၉-၇၃၀၁၂၁၈၅၊ ၀၉-၇၃၀၄၁၄၁၉', 'အမွတ္္(၂၇)၊ အေနာက္ျမင္းျပိဳင္ကြင္းလမ္း၊ ဗုိလ္စိန္မွန္၊ ဂြတ္တလစ္။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
(509, 1, 'ေရႊဇင္ - အမွတ္(၁၃၆)၊ ကတန္္ကြ်န္းလမ္း၊ ၂၅ ရပ္ကြက္၊ ေယာက္ေကာ္မွတ္တုိင္အနီး ၊ေတာင္ဒဂုံ။', '၀၁-၈၁၀၀၄၃၁', 'အမွတ္(၁၃၆)၊ ကတန္္ကြ်န္းလမ္း၊ ၂၅ ရပ္ကြက္၊ ေယာက္ေကာ္မွတ္တုိင္အနီး ၊ေတာင္ဒဂုံ။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
(510, 2, 'ေအာင္သုခ - တ/ဥကၠလာပျမိိဳ့နယ္။', '၀၉-၇၃၀၈၇၈၅၂', 'ပါရမီလမ္းမ ၊ေရႊမန္းသူ-ရွမ္းမေလး အေ၀းေျပးကား၀င္း၊ တ/ဥကၠလာပျမိိဳ့နယ္။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
(511, 2, 'ေအာင္သုခ - ေျမနီကုန္း', '၅၀၀၂၀၈', 'ေျမနီကုန္းလမ္းဆုံ ၊ေရႊမန္းရုပ္ရွင္ရုံအနီး၊ ပဒုမၼာဇာတ္ရုံေရွ့။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
(512, 2, 'ေအာင္သုခ - အထက္ပုဇြန္ေတာင္', '၀၉-၇၃၀၂၇၃၂၃', 'အထက္ပုဇြန္ေတာင္လမ္းမ၊ ပုဇြန္ေတာင္္ေဈးေရွ့ ကားမွတ္တို္င္အနီး။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
(513, 2, 'ေအာင္သုခ - သဃၤန္းကြ်န္း', '၀၉-၇၃၁၁၉၀၃၀', 'သဃၤန္းကြ်န္း၊ စံျပေဈး၊ မီးပိြဳင့္အနီး။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
(514, 2, 'ေအာင္သုခ -ဆင္မလုိက္', '၄၂၁၀၁၃၀၃၇', 'ေရႊဂုံတုိင္္မီးပိြဳင့္အနီး ၊ေအာင္သေျပတံဆိပ္ရုိက္အနီး ၊ေရႊဂုံတုိင္။', 1, 0, 0, 0, 0, 11, '0000-00-00 00:00:00', '2014-12-16 15:00:46'),
